import React, {useState, useEffect} from 'react';

const axios = require('axios');

export const History = () => {
    const [data,setData]=useState([]);

    /* set state data */
    useEffect(()=>{
        /* construct url queries */
        const url = 'http://localhost:3001/fires?Counties=';
        const arr = ["Sonoma", "Butte", "Napa"];
        const queries = arr.map(county => axios.get(url+county));

        let temp = [];
        const getData = () => {
            axios.all(queries)
            .then(resArr => {
                temp = resArr.map(resArr => resArr.data);
                setData(temp);
            });
        };
        getData();
    },[])

    console.log(data);

    return( <p>hi</p> );
}
